import React from 'react'
import Layout from '../../components/MyLayout'
import axios from 'axios';

export default class Registration extends React.Component {
    state = {
        location_info:{
            name: '',
            region: '',
            address: '',
            phone: '',
            web: '',
            geo: {
                lat:0.0,
                lng:0.0
            },
        },
        payment_info: {
            motorcycle: [0,0],
            car : [0,0],
            rv : [0,0]
        }
    }

    handleLocationInfoChange = event => {
        const {location_info} = {...this.state};
        const currentState = location_info;
        const { name, value } = event.target;
        currentState[name] = value;
        this.setState({ location_info : currentState });
    }
    handlePaymentInfoChange = event => {
        const {payment_info} = {...this.state};
        const currentState = payment_info;
        const { name, value } = event.target;
        currentState[name] = value;
        this.setState({ payment_info : currentState });
    }

    handleSubmit = event => {
        event.preventDefault();

        const user = {
            name: this.state.name,

        };

        axios.post(`http://localhost/parkpay/parks`,{user})
        .then(res => {

        })
    }

    render(){
        return(
            <Layout>
                <div>
                    <h1>Register new park</h1>
                <form onSubmit={this.handleSubmit}>
                <div class="form-group">
                    <label for="exampleInputEmail1">Park Name</label>
                    <input class="form-control" type="text" placeholder="location_info" name="name" value={this.state.location_info.name} onChange={this.handleLocationInfoChange} />
                    <small id="emailHelp" class="form-text text-muted">We'll never share your email with anyone else.</small>
                </div>
                <div class="form-group">
                    <label for="exampleInputEmail1">Region</label>
                    <input class="form-control" type="text" name="region" value={this.state.location_info.region} onChange={this.handleLocationInfoChange} />
                    <small id="emailHelp" class="form-text text-muted">We'll never share your email with anyone else.</small>
                </div>
                <div class="form-group">
                    <label for="exampleInputEmail1">Address</label>
                    <input class="form-control" type="text" name="address" value={this.state.location_info.region} onChange={this.handleLocationInfoChange} />
                    <small id="emailHelp" class="form-text text-muted">We'll never share your email with anyone else.</small>
                </div>
                <div class="form-group">
                    <label for="exampleInputEmail1">Phone</label>
                    <input class="form-control" type="text" name="phone" value={this.state.location_info.region} onChange={this.handleLocationInfoChange} />
                    <small id="emailHelp" class="form-text text-muted">We'll never share your email with anyone else.</small>
                </div>
                <div class="form-group">
                    <label for="exampleInputEmail1">Web</label>
                    <input class="form-control" type="text" name="web" value={this.state.location_info.region} onChange={this.handleLocationInfoChange} />
                    <small id="emailHelp" class="form-text text-muted">We'll never share your email with anyone else.</small>
                </div>
                <button type="submit">Add</button>
                </form>
            </div> 
          </Layout>
        )
    }

}
